window.bookSummaryJSON = "<p><strong>A Good Morning America YA Book Club Pick! </strong></p><p><strong>Lose yourself in this exhilarating return to the #1 global bestselling Shatter Me universe, the first book in a new series set ten years after the fall of The Reestablishment.</strong></p><p><strong>James Anderson had a plan.</strong> Or half of one. He managed to do what his older brother, the famous Aaron Warner Anderson, never did: infiltrate Ark Island, the last refuge of The Reestablishment. No outsider has breached the stronghold of the authoritarian regime, but James is <em>in</em>. In a prison cell, sure, but as far as James is concerned, a win is a win.</p><p>It’s been ten years since the notorious duo Juliette Ferrars and Aaron Warner Anderson led a worldwide rebellion and established the New Republic of the West. But The Reestablishment is ready to make a devastating move, and they have the perfect assassin for the job.</p><p><strong>Rosabelle Wolff had a plan.</strong> She always has a plan. On Ark Island, where constant surveillance is packaged as security, even emotions must be experienced with caution. Her every movement is monitored—and when she’s given an order to kill, she never hesitates.</p><p>Brimming with pulse-pounding action and torturous romance, <em>Watch Me</em> is an explosive journey through a dystopian landscape where enemies-to-lovers has never felt more impossible. Step into a beloved and breathtaking world that demands an answer to a desperate question—</p><p><strong><em>Who are we when no one is watching?</em></strong></p>"; 
